import { useSelector } from "react-redux"

const SongList = () => {
    const songs = useSelector((state) => state.songStore.value)
    const jsxSongs = songs.map(i => <li>{i.songName}</li>)
    return(
        <ol>
            {jsxSongs}
        </ol>
    )
}
export default SongList
